package com.mycompany.ClinicaOdontologica.model;import jakarta.persistence.Entity;import lombok.Getter;import lombok.Setter;import java.util.Date;@Getter@Setter@Entitypublic class Secretariat extends Person{    private String sector ;    public Secretariat (){    }    public Secretariat(Long idPerson, String dni, String name, String lastname, String phoneNumber, String address, Date birthdate, String sector) {        super(idPerson, dni, name, lastname, phoneNumber, address, birthdate);        this.sector = sector;    }}